import React from "react";
import NavBar from "./NavBar";

const Header = () => {
	return (
		<header className="hero">
			<img className="smiley" src="/media/smiley.svg" alt="smiley-animation" />
			<div className="hero-text">
				<h1 className="intro-text">
					Hej, I am Sofia Darke, a web developer from Stockholm currently
					studying at Hyper Island.
				</h1>
				<a className="cto-header" href="https://github.com/sofiadarkeweb">
					GitHub
				</a>
				<a className="cto-header" href="">
					LinkedIn
				</a>
			</div>
			<NavBar />
		</header>
	);
};

export default Header;
